import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import archive from '../../assets/icons/albums.svg';
import Chip from '@material-ui/core/Chip';
import Typography from '@material-ui/core/Typography';

import Card from '@material-ui/core/Card';

const useStyles = makeStyles((theme) => ({
  image: {
       width: '92px',
    height: '78px',
   },
  Card: {
    width: "370px",
    height: "324px",
    Background: "#FFFFFF 0% 0% no-repeat padding-box",
    boxShadow: "0px 12px 32px #383B470F",
    border: "0.23999999463558197px solid #DDDDDD80",
    borderRadius: "12px"
  },
  chip: {
    marginBottom:'15px',
    marginLeft:'114px'
  },
  paragraph: {
    font: "400 16px/24px PT Sans",
    letterSpacing: "0px",
    color: "#868E96",
    opacity: "1",
    height: '52px',
    width: "310px",
    justifyContent: 'center',
    padding: '0 30px'
  },
  ImageCard:{
    width: '100%',
    display: 'flex',
    alignItems:' center',
    justifyContent: 'center',
    marginTop: '50px',
  },
  title:{
    width:'100px',
    align:'center'
  },
  h6:{
    color:'#212529',
    marginTop:'34px',

  }
}));

const Cards = (props) => {
  const classes = useStyles(props);

  return (
    <div className={classes.Card}>
      <div className={classes.ImageCard}>
      <img src={archive} alt="logo" className={classes.image} />
      </div>
      <Typography variant="h6" align="center" classes={{
        h6:classes.h6
      }}>District population</Typography>
      <p className={classes.paragraph}>
        This should be used to tell a story and let your users know more
        about your service. How can you benefit them?
          </p>
      <Chip size="medium" color="primary" label="342+ DATASETS" classes={{
        chip:classes.chip
      }}></Chip>
    </div>
  );
}

export default Cards;
